import React from 'react'
import {Link, Redirect} from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import "../../static/style.css"


const Landing = ({userVerified}) => {
    if(userVerified)
    {
      // console.log('hihihihih');
      return (<Redirect to='/dashboard'/>)
    }
    return (
      <div class="container jobs-push-hero__inner">

        <div class="jobs-push-icon jobs-push-icon--preload">
      <div class="jobs-push-icon__magic jobs-push-icon__magic--1"></div>
      <div class="jobs-push-icon__magic jobs-push-icon__magic--2"></div>
      <div class="jobs-push-icon__magic jobs-push-icon__magic--3"></div>
    </div>

    </div>
    )
}
Landing.propTypes ={
  userVerified: PropTypes.bool,
};

const mapStateToProps = (State) => ({
  userVerified: State.authReducer.userVerified
});

export default connect(mapStateToProps)(Landing);
